import React from 'react';
import { StyleSheet, Text, View } from 'react-native';

export default function sandbox() {
    return (
        <View style={styles.container}>
            <Text styles={styles.boxOne}>Box One</Text>
            <Text styles={styles.boxTwo}>Box Two</Text>
            <Text styles={styles.boxThree}>Box Three</Text>
            <Text styles={styles.boxFour}>Box Four</Text>
                      
        </View>
    );
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        paddingTop:40,
        backgroundColor: '#ddd',
    },
    boxOne: {
        backgroundColor:'',
        padding:10,
    },
    boxTwo: {
        backgroundColor:'green',
        padding:10,
    },
    boxThree: {
        backgroundColor:'yellow',
        padding:10,
    },
    boxFour: {
        backgroundColor:'red',
        padding:10,
    }
    

})
